"""Generate Arabic (AR) translations for all missing keys."""
import json, os

BASE = os.path.join(os.path.dirname(os.path.abspath(__file__)), 'src/lib/i18n/locales')

def set_nested(obj, dotpath, value):
    parts = dotpath.split('.')
    for part in parts[:-1]:
        if part not in obj or not isinstance(obj[part], dict):
            obj[part] = {}
        obj = obj[part]
    obj[parts[-1]] = value

with open(os.path.join(BASE, 'ar.json'), 'r') as f:
    locale = json.load(f)

